import React from 'react';
import Navbar from '../Components/Navbar';
import Sidebar from '../Components/Sidebar';
import DashboardBody from '../Components/Dashboard Components/DashboardBody';
export default function Dashboard() {
  const colour = { colour: "#FE4747", backgroundcolour: "#FF6B6B29" };
  const handleVenues="kids";
  return (
    <>
      <div className="flex">
        <Sidebar colour={colour} />
        <div className="flex-1">
          <Navbar />
          <DashboardBody handleVenues={handleVenues}/>
        </div>
      </div>
    </>
  );
}
